import React from "react";
export function Overlay({
  media_id,
  media_category,
  experience,
  watchData,
  listenData,
}) {
  console.log(media_id);
  if (experience === "WATCH" && media_id.length !== 0) {
    const records = watchData[media_category];
    const media_data = watchData[media_category].find(
      (key) => key.id === media_id
    );
    console.log(records);
    console.log(media_data);
  }
  return <div></div>;
}
